import React from "react";

import { Link } from 're'

const Navegacion = () => {
    return (
        <aside className="sidebar col-3">
            <h2>Administracion</h2>
            <nav className="navegacion">
                <a href="/" className="usuarios">Usuarios</a>
                <a href="cuentas" className="cuentas">Cuentas</a>
            </nav>

        </aside>
    )
}
export default Navegacion;
